import React, { useState, useEffect } from 'react';
import Modal from './Modal';

const DB_Modal = ({ showModal, onCloseModal, URL }) => {
    const [data, setData] = useState('Hello Modal');

    useEffect( async () => {
        const operations = await fetch(`${URL}/operation?amount=10`);
        if (operations.ok){
            const response = operations.json();
            console.log(response);
        }
    }, [])

    return (
    <Modal isOpen={showModal} onClose={onCloseModal} data={data} />
    );
    if (!showModal) return null;

    return (
        <div className="modal">
            <div className="modal-content">
                <span className="close" onClick={onCloseModal}>&times;</span>
                {data ? (
                    <div>
                        {/* Render your data here */}
                        <h1>{data}</h1>
                    </div>
                ) : (
                    <p>Loading...</p>
                )}
            </div>
        </div>
    );
};

export default DB_Modal;
